    'tnc_page_online_privacy_statement': 'BerryPay Online Privacy Statement',
    'tnc_page_online_privacy_text':
        'BerryPay respects your privacy. We want to make use of individual identifying information that you provide to us for purposes of serving you better. "Individual identifying information" is information that enables us to identify you, such as your email address, name, title and address. BerryPay uses the individual identifying information in order to personalize your experience on our website and also to be able to selectively send you communications that may be of interest to you, either electronically or otherwise.',
    'tnc_page_policy_info':
        'BerryPay\'s policy regarding use of your individual identifying information supplied to us or collected via your experience at our online website covers these areas:',
    'tnc_page_notice_and_disclosure_list': '1. Notice and Disclosure',
    'tnc_page_notice_and_disclosure_text':
        'This Online Privacy Statement is made available to you in order to make you aware of how BerryPay collects and uses individual identifying information of visitors to BerryPay\'s website.BerryPay collects the following information regarding visitors to our website: domain name, name, information regarding what pages are accessed, information volunteered by you, such as survey information, email address, or site registrations, and your preferred means of communication.BerryPay does make individual identifying information available to third parties, including business partners, for marketing purposes. BerryPay also uses such information to contact people for marketing purposes.',
    'tnc_page_choice_consent_list': '2. Choice/Consent',
    'tnc_page_choice_consent_text':
        'New registrants to website have the choice to opt out of having individual identifying information provided in the registration process used for any purpose unrelated to the purpose for which the information was provided to us. We are working on ways to enable you to communicate to us that your individual identifying information should not be used for additional purposes. When you sign up for an email list, you will be given instructions at that time on how to remove yourself from that list. Access to certain of BerryPay\'s webpages require a login and password The use of those webpages, and the information or programs downloadable from those sites, may be governed by a written agreement between the   program and BerryPay. Your individual identifying information may be retained by BerryPay to verify compliance with the agreement, log software licenses granted, to track software downloaded from those pages, or track usage of other applications available on website.',
    'tnc_page_data_security_list': '3. Data Security',
    'tnc_page_data_security_text':
        'BerryPay is committed to taking reasonable steps to protect the individual identifying information that you provide to us.',
    'tnc_page_data_quality_access_list': '4. Data Quality and Access',
    'tnc_page_data_quality_access_text':
        'The accuracy of your individual identifying information is important to BerryPay. We are working on ways to make it easier for you to review and correct the information that BerryPay maintains about you. Registered BerryPay users can review their individual identifying information by accessing the BerryPay Application with a username and password.',
    'tnc_page_cookies_list': '5. Use of Cookies',
    'tnc_page_cookies_text':
        'A cookie is a small data file that certain applications write to your hard drive when you visit them. A cookie file can contain information such as a user ID that the site uses to track the pages you\'ve visited, but the only personal information a cookie can contain is information you supply yourself. A cookie can\'t read data off your hard disk or read cookie files created by other sites. If you prefer not to receive cookies, you can set your browser to warn you before accepting cookies and refuse the cookie when your browser alerts you to its presence. You can also refuse all cookies by turning them off in your browser.',
